ariable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2446990","type":"CustomJS"},{"attributes":{"line_alpha":{"value":0.2},"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"2446871","type":"Segment"},{"attributes":{"coordinates":null,"data_source":{"id":"2446620"},"glyph":{"id":"2446807"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2446809"},"nonselection_glyph":{"id":"2446808"},"view":{"id":"2446811"}},"id":"2446810","type":"GlyphRenderer"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D/o8sQ9n8vvPxAbPREcVO8/kbf9HZMW7z9TjMVI1XPuP38zXicvyu4/qSSV3nyQ7j/w5FrCT6TuP0ddhbEZSe4/WyLgX6c57j/Mz+A5E+/tP9LdPLB/2e0/AN7iH8bk7T9hsLhCU9vtP5aZ/Xq4xu0/LkMBcrne7T8a9JppxuPtPwXFpzsxTe4/l6kyVBFT7j+laWr21KPuPydyTAyFTO4/4PaSMwUs7j/mtg7yoNftP/lTZrka6O0/E/XuD5ya7T9mkSvg2lztP3QoFh3kLO0/dnM7jnf07D9/AKlSVRbtP3182Npdce0/4Ec+y4Ra7T/u/V2OxIPtPyvgd/uHV+0/yyZrHog/7T/
